// Desestructuracion
// Asignacion Desestructurante


const persona = {
    nombre: 'Tony',
    edad: 45,
    clave: 'Iroman'
}



const userContext = ({clave, edad, nombre, rango = 'Capitan'}) => {

    return {
        nombreClave: clave,
        anios: edad
    }
}

const avenger = userContext( persona );


console.log(avenger);
